import React from 'react';
import { Link } from 'react-router-dom';
import './compWelcome.css';

function Welcome() {
    return (
        <div className="page">
            <div className="welcome-container">
                <h1 className="welcome-title">Welcome to Our Application!</h1>
                <p className="welcome-text">Please log in or sign up to continue.</p>
                <div className="welcome-buttons">
                    <Link to="/login" className="welcome-button">Log In</Link>
                    <Link to="/signup" className="welcome-button">Sign Up</Link>
                </div>
            </div>
        </div>
    );
}

export default Welcome;
